      fileURL: null,
    },
    '2': {
      id: '2',
      fileName: 'Fuck!!! I want to go home like crazy!!!!!!',
      fileURL: null,
    },
  })

  return (
    <MarkerDiv>
      <ContainerDiv>
        <CardEditor1210 />
        <Preview1210 cards={cards} />
      </ContainerDiv>
    </MarkerDiv>
  )
}

export default Marker1210
